import React from 'react';
import Autocomplete from "./Autocomplete";

class Overlay extends React.Component {

	constructor(props) {
	    super(props)
	    this.state = {
	      value: '',
	      items: [
			    { label: 'apple' },
			    { label: 'banana' },
			    { label: 'pear' }]
	    };
    }	

	async componentDidMount() {
		this.setState({ 
			value: ''
		});

		var promise = await fetch('https://places.cit.api.here.com/places/v1/autosuggest?at=47.151726,27.587914&q=palas&app_id=eiPUTOVjxY1rwovi7Kwi&app_code=obXES72dtgrH1PgkTGNWNQ');
		var test = await promise.json();
		console.log(test);	
	 }

	render() {
    	return 
    	<div className="overlay"> 
			<Autocomplete
			  getItemValue={(item) => item.label}
			  items={this.state.items}
			  renderItem={(item, isHighlighted) =>
			    <div style={{ background: isHighlighted ? 'lightgray' : 'white' }}>
			      {item.label}
			    </div>
			  }
			  	value={this.state.value}
			  	onChange={(event, value) => { this.setState({ value })}}
				onSelect = {(val, item) => { console.log(item)} }
			/>
    	</div>;
  	}
}
export default Overlay;
